                            {/* <div>{item[0]}</div> */}
                        </Col>
                    ) : console.log('nothing')}
                    </Row>
                </Container>
            </div>
            }
        </Layout>
    );
}

Index.getInitialProps = async (context) => {

    let query = context.query;
    return {query};
}

export default Index;
